textOriginal:
Inimigos da Pátria Brasil. Mas vivem as custas do nosso dinheiro

Tem um verso q diz: O ladrão vem APENAS para ROUBAR, MATAR E DESTRUIR; 

 JOÃO 10:10a

Siceramente tenho que concordar com o Alexandre Garcia, estas manisfestações só prejudicam as familias;
Não poderemos reverter os votos, manifesto meu repúdio aos 32 Milhões de eleitores que se acorvardaram ao não irem votar / Branco ou nulo também;
Repudio tb os 69% dos nordestinos que optaram um ladrão ao invés do progresso minha pergunta é: Quem gera emprego e renda no nordeste é o Lula? é os traficantes? é os esquerdistas? Tenho ceteza que são os empresários e turistas em sua maiorias conservadores;
Parabenizo o Sr. Presidente que lutou contra todo um Sistema e colocou sua vida e de sua família em risco a favor da nossa nação;
Aos 58 Milhões de patriotas que votarm no progresso e infelizmente por 2 Milhões não foi desta vez.
Agora é Deus e apertem os sintos pq com este lulalau no poder só consigo v: Miséria, regresso e novamente nosso dinheiro indo p outros países.
